import React from "react";
const { cart } = useCartContext();
console.log(cart);

const Singleproduct = () => {
  return (
    <>
      {cart.map((cur) => {
        return (
          <>
            <h1 className="modal__title">Welcome to the Cart!</h1>
            <div className="modal__body"></div>
          </>
        );
      })}
    </>
  );
};

export default Singleproduct;
